		protected override long m_lngSubModify()
		{
            if (txtInPatientID.Text != m_objCurrentPatient.m_StrHISInPatientID || txtInPatientID.Text == "")
			{
				m_mthShowNoPatient();
				return -1;
			}

            if (m_txtSign.Tag == null)
            {
                clsPublicFunction.ShowInformationMessageBox("请记录者签名！");
                return -1;
            }
            //没有key盘或者key盘持有人不在签名集合则不能保存
            com.digitalwave.emr.BEDExplorer.clsHospitalManagerDomain objCompareTokey = new com.digitalwave.emr.BEDExplorer.clsHospitalManagerDomain();
            if (objCompareTokey.m_lngCompareTOkey( ((clsEmrEmployeeBase_VO)m_txtSign.Tag).m_strEMPNO_CHR) == false)
            {
                MessageBox.Show("检测不到key盘或者key盘持有者不是当前签名者，不能继续操作", "iCare Message", MessageBoxButtons.OK, MessageBoxIcon.Information);
                return -1;
            }
			//定义Package
			clsOperationEquipmentPackage m_objPackage = new clsOperationEquipmentPackage();			
			//定义主表
			clsOperationEqipmentQtyXML objOperationEqipmentQtyXML=new clsOperationEqipmentQtyXML(); 			
			//定义子表
			clsOperationEqipmentQtyContent objOperationEqipmentQtyContent=new clsOperationEqipmentQtyContent(); 
			
			string strNowTime=DateTime.Now.ToString("yyyy-MM-dd HH:mm:ss");
			objOperationEqipmentQtyContent.strModifyDate=strNowTime;		
			
			clsOperationEquipmentPackage objclsOperationEquipmentPackageOld;
			long lngSuccess=m_objDomain.lngSelectDisply(m_strInPatientID,m_strInPatientDate,trvTime.SelectedNode.Tag.ToString(),out objclsOperationEquipmentPackageOld);
			
			if(lngSuccess>0 && objclsOperationEquipmentPackageOld !=null && objclsOperationEquipmentPackageOld.m_objOperationEqipmentQtyContent !=null 
				&& m_objCurrentPackage !=null && m_objCurrentPackage.m_objOperationEqipmentQtyContent !=null 
				&& DateTime.Parse(objclsOperationEquipmentPackageOld.m_objOperationEqipmentQtyContent.strModifyDate) != DateTime.Parse(m_objCurrentPackage.m_objOperationEqipmentQtyContent.strModifyDate))
			{//本判断根据最后修改时间的大小比较得到	,只可能大于（被修改）或等于（没修改），不可能小于（此时查询时为空记录）
				m_objCurrentPackage=objclsOperationEquipmentPackageOld;
				m_mthShowCurrentPackage(m_objCurrentPackage);//更新显示
				clsPublicFunction.ShowInformationMessageBox("对不起，你正在修改的记录已经被他人修改！");
				
				return -101;//若最新记录改变时的返回值
			}			
			else if(lngSuccess<=0)
			{
				clsPublicFunction.ShowInformationMessageBox("数据错误或数据库连接失败，请与系统管理员联系！");
				return -200;
			}

			//修改记录：提取原来记录中的开放时间及创建者				
			if(objclsOperationEquipmentPackageOld !=null && objclsOperationEquipmentPackageOld.m_objOperationEqipmentQtyXML!=null)
			{
				objOperationEqipmentQtyXML.strOpenDate=objclsOperationEquipmentPackageOld.m_objOperationEqipmentQtyXML.strOpenDate;
				objOperationEqipmentQtyXML.strCreateUserID=objclsOperationEquipmentPackageOld.m_objOperationEqipmentQtyXML.strCreateUserID;
				objOperationEqipmentQtyXML.strCreateDate=objclsOperationEquipmentPackageOld.m_objOperationEqipmentQtyXML.strCreateDate;
			}
			else 
			{
				clsPublicFunction.ShowInformationMessageBox("你所修改的记录已被他人删除或不存在！");
				m_objCurrentPackage=null;
				return -11;
			}
			
			objOperationEqipmentQtyContent.strOpenDate=objOperationEqipmentQtyXML.strOpenDate;
			
			//*******************************************************************************
			//护士付值
			int intcount=0;
			for(int j=0;j<this.dtbNurse.Rows.Count;j++ )
			{
				for(int i=6;i<this.dtbNurse.Columns.Count;i++)
				{
					if(this.dtbNurse.Rows[j][i].ToString()!="")
					{
                       intcount ++;
					}
				}
			}

			if(intcount>0)
			{
				clsOperationNurse[] objOperationNurse=new clsOperationNurse[intcount]; 
				m_objPackage.m_objOperationNurse= objGetNurse(objOperationNurse,objOperationEqipmentQtyXML.strOpenDate);
			}
			//子表付值
			m_objPackage.m_objOperationEqipmentQtyContent= objGetContentInsert(objOperationEqipmentQtyContent);
			//主表
			m_objPackage.m_objOperationEqipmentQtyXML= objGetMasterInsert(objOperationEqipmentQtyXML,true);
				
			long lngSave= m_objDomain.lngModify(m_objPackage,m_strInPatientID,m_strInPatientDate,objOperationEqipmentQtyXML.strOpenDate); 
			if(lngSave<=0)
				//**********************************自动测试
				//				return 1;
			{	
				MessageBox.Show("操作错误，请重试！"); 
				m_objCurrentPackage=null;
			}				
			else 
				m_objCurrentPackage= m_objPackage;
			return lngSave;
			
		}

     	protected override long m_lngSubAddNew()
		{
            if (txtInPatientID.Text != m_objCurrentPatient .m_StrHISInPatientID|| txtInPatientID.Text == "")
			{
				m_mthShowNoPatient();
				return -1;
			}
            if (m_txtSign.Tag == null)
            {
                clsPublicFunction.ShowInformationMessageBox("请记录者签名！");
                return -1;
            }

            //没有key盘或者key盘持有人不在签名集合则不能保存
            com.digitalwave.emr.BEDExplorer.clsHospitalManagerDomain objCompareTokey = new com.digitalwave.emr.BEDExplorer.clsHospitalManagerDomain();
            if (objCompareTokey.m_lngCompareTOkey(((clsEmrEmployeeBase_VO)m_txtSign.Tag).m_strEMPNO_CHR) == false)
            {
                MessageBox.Show("检测不到key盘或者key盘持有者不是当前签名者，不能继续操作", "iCare Message", MessageBoxButtons.OK, MessageBoxIcon.Information);
                return -1;
            }
			int m_Rows=0;
			long lngIfSave=m_objDomain.lngSelectBeforSave(m_strInPatientID,m_strInPatientDate,this.dtpOperationTime.Value.ToString("yyyy-MM-dd HH:mm:ss") ,out m_Rows);
			if(lngIfSave>0 && m_Rows>0)////Add New
			{
				clsPublicFunction.ShowInformationMessageBox("对不起,申请时间重复！");
				dtpOperationTime.Focus();
				return -1;
			}
			else if(lngIfSave<=0)
			{
				clsPublicFunction.ShowInformationMessageBox("数据库连接失败！");
				return lngIfSave;
			}

			int intcount=0;
			//定义Package
			clsOperationEquipmentPackage m_objPackage = new clsOperationEquipmentPackage();			
			//定义主表
			clsOperationEqipmentQtyXML objOperationEqipmentQtyXML=new clsOperationEqipmentQtyXML(); 			
			//定义子表
			clsOperationEqipmentQtyContent objOperationEqipmentQtyContent=new clsOperationEqipmentQtyContent(); 
			

			string strNowTime=DateTime.Now.ToString("yyyy-MM-dd HH:mm:ss");	

			//添加记录：新时间及新创建者
			objOperationEqipmentQtyXML.strOpenDate=strNowTime;
			objOperationEqipmentQtyXML.strCreateUserID=MDIParent.strOperatorID;					
			objOperationEqipmentQtyXML.strCreateDate=dtpOperationTime.Value.ToString("yyyy-MM-dd HH:mm:ss");
				
			objOperationEqipmentQtyContent.strOpenDate=strNowTime;
			objOperationEqipmentQtyContent.strModifyDate=strNowTime;	
			

			//*******************************************************************************
			//护士付值
			for(int j=0;j<this.dtbNurse.Rows.Count;j++ )
			{
				for(int i=6;i<this.dtbNurse.Columns.Count;i++)
				{
					if(this.dtbNurse.Rows[j][i].ToString()!="")
					{
						intcount ++;
					}
				}
			}
			if(intcount>0)
			{
				clsOperationNurse[] objOperationNurse=new clsOperationNurse[intcount]; 
				m_objPackage.m_objOperationNurse= objGetNurse(objOperationNurse,strNowTime);
			}
			//子表付值
			m_objPackage.m_objOperationEqipmentQtyContent= objGetContentInsert(objOperationEqipmentQtyContent);
			//主表
			m_objPackage.m_objOperationEqipmentQtyXML= objGetMasterInsert(objOperationEqipmentQtyXML,false);
				
			long lngSave= m_objDomain.lngAddNewRecord(m_objPackage); 
			if(lngSave<=0)
				//**********************************自动测试
//				return 1;

				MessageBox.Show("操作错误，请重试！"); 
			else 
			{
				dtpOperationTime.Enabled=false;
				string strDate=dtpOperationTime.Value.ToString("yyyy年MM月dd日 HH:mm:ss");
				TreeNode trnDate=new TreeNode(strDate);
				trnDate.Tag =strNowTime;
				this.trvTime.Nodes[0].Nodes.Insert(0,trnDate );

				blnCanSearch=false;
				trvTime.SelectedNode=this.trvTime.Nodes[0].FirstNode;
				blnCanSearch=true;

				m_objCurrentPackage= m_objPackage;
			}
			return lngSave;
			
		}
