		protected override long m_lngSubDelete()
		{
            if (this.txtInPatientID.Text != m_objCurrentPatient.m_StrHISInPatientID || txtInPatientID.Text == "")	
			{
				m_mthShowNoPatient();
				return -1;
			}
			if(trvTime.SelectedNode==null || trvTime.SelectedNode.Text.Length !=20)
			{				
				clsPublicFunction.ShowInformationMessageBox("请选择相应的创建时间再删除");
				return -1;
			}
			long lngRes= m_objDomain.m_lngDelete(MDIParent.strOperatorID,m_strInPatientID,m_strInPatientDate,trvTime.SelectedNode.Tag.ToString());
			if(lngRes <=0)
			{
				clsPublicFunction.ShowInformationMessageBox("删除失败");
			}
			else 
			{			
				trvTime.SelectedNode.Remove();
				trvTime.SelectedNode=trvTime.Nodes[0];
				m_objCurrentPackage=null;
			}
			return lngRes;
			
		}
