		#region 从界面得到护士内容
		/// <summary>
		/// 护士
		/// </summary>
		/// <param name="m_objNurse"></param>
		/// <returns></returns>
		public clsOperationNurse [] objGetNurse(clsOperationNurse [] m_objNurse,string strOpenDate)
		{
			int count=0;
			
			for(int j=0;j<this.dtbNurse.Rows.Count;j++ )
			{
				for(int i=6;i<this.dtbNurse.Columns.Count;i++)
				{
					if(this.dtbNurse.Rows[j][i].ToString()!="")
					{
						int intFlag=i-6;
						clsOperationNurse objNurse=new clsOperationNurse();
						objNurse.strNurseFlag=intFlag.ToString(); 
						objNurse.strNurseID=this.dtbNurse.Rows[j][i].ToString(); 
						objNurse.strInPatientDate=m_strInPatientDate;
						objNurse.strInPatientID=m_strInPatientID ;
						objNurse.strOpenDate=strOpenDate;
						objNurse.strStatus="0" ;
						m_objNurse[count] =objNurse;
						count++; 
					}
				}
			}
			
			return m_objNurse;
		}

