		private void m_mthShowCurrentSheet(string p_strInPatientID,string p_strInPatientDate,string p_strOpenDate)
		{
			clsOperationEquipmentPackage m_objPackage = null;
			
			long lngRes=m_objDomain.lngSelectDisply(p_strInPatientID ,p_strInPatientDate,p_strOpenDate ,out m_objPackage);
			if( lngRes>0)
				m_mthShowCurrentPackage(m_objPackage);
			else
			{
				clsPublicFunction.ShowInformationMessageBox("数据库连接失败！");
			}
		}

		private void m_mthShowDeletedSheet(string p_strInPatientID,string p_strInPatientDate,string p_strOpenDate)
		{
