				if(objNurse!=null && lngResult>0)
				{

					m_objCurrentPackage.m_objOperationNurse=objNurse;
					#region 计算最大行
					int Rows=1;
					int [] rowsFlag=new int[6]{1,1,1,1,1,1};
					ArrayList arlRows=new ArrayList();
					for(int i=0;i<intNurseCount;i++)
					{
						if(objNurse[i].strNurseFlag=="0")
						{
							if(arlRows.Contains(objNurse[i].strNurseFlag))
							{
								rowsFlag[0]++;
								Rows =rowsFlag[0]>Rows? rowsFlag[0]:Rows ;
							}
							else 
								arlRows.Add(objNurse[i].strNurseFlag);
						}
						if(objNurse[i].strNurseFlag=="1")
						{
							if(arlRows.Contains(objNurse[i].strNurseFlag))
							{
								rowsFlag[1]++;
								Rows =rowsFlag[1]>Rows? rowsFlag[1]:Rows ;
							}
