							{
								rowsFlag[3]++;
								Rows =rowsFlag[3]>Rows? rowsFlag[3]:Rows ;
							}
							else 
								arlRows.Add(objNurse[i].strNurseFlag);
						}
						if(objNurse[i].strNurseFlag=="4")
						{
							if(arlRows.Contains(objNurse[i].strNurseFlag))
							{
								rowsFlag[4]++;
								Rows =rowsFlag[4]>Rows? rowsFlag[4]:Rows ;
							}
							else 
								arlRows.Add(objNurse[i].strNurseFlag);
						}
						if(objNurse[i].strNurseFlag=="5")
						{
							if(arlRows.Contains(objNurse[i].strNurseFlag))
							{
								rowsFlag[5]++;
								Rows =rowsFlag[5]>Rows? rowsFlag[5]:Rows ;
							}
							else 
								arlRows.Add(objNurse[i].strNurseFlag);
						}
				
					}
					#endregion
					
					
					for(int j=0;j<Rows;j++)
					{
						Object [] objRows=new object[12];
						for(int j1=0;j1<12;j1++)
						{
							objRows[j1]="";

						}
						dtbNurse.Rows.Add(objRows);
					}
			
					for(int i=0;i<objNurse.Length ;i++)
					{
						for(int i1=0;i1<Rows;i1++)
						{
							if(objNurse[i].strNurseFlag=="0"&&dtbNurse.Rows[i1][0].ToString()=="")
							{
								dtbNurse.Rows[i1][0]=new clsEmployee(objNurse[i].strNurseID,objNurse[i].strNurseName).m_StrFirstName;
								dtbNurse.Rows[i1][6]=objNurse[i].strNurseID;
								arlNurse.Add(objNurse[i].strNurseID);
								break;

							}
							
							if(objNurse[i].strNurseFlag=="1"&&dtbNurse.Rows[i1][1].ToString()=="")
							{
								dtbNurse.Rows[i1][1]=new clsEmployee(objNurse[i].strNurseID,objNurse[i].strNurseName).m_StrFirstName;
								dtbNurse.Rows[i1][7]=objNurse[i].strNurseID;
								arlNurse.Add(objNurse[i].strNurseID);
								break;
													
							}
							if(objNurse[i].strNurseFlag=="2"&&dtbNurse.Rows[i1][2].ToString()=="")
							{
								dtbNurse.Rows[i1][2]=new clsEmployee(objNurse[i].strNurseID,objNurse[i].strNurseName).m_StrFirstName;
								dtbNurse.Rows[i1][8]=objNurse[i].strNurseID;
								arlNurse.Add(objNurse[i].strNurseID);
								break;
				
							}
							if(objNurse[i].strNurseFlag=="3"&&dtbNurse.Rows[i1][3].ToString()=="")
							{
								dtbNurse.Rows[i1][3]=new clsEmployee(objNurse[i].strNurseID,objNurse[i].strNurseName).m_StrFirstName;
								dtbNurse.Rows[i1][9]=objNurse[i].strNurseID;
								arlNurse.Add(objNurse[i].strNurseID);
								break;
					
							}
							if(objNurse[i].strNurseFlag=="4"&&dtbNurse.Rows[i1][4].ToString()=="")
							{
								dtbNurse.Rows[i1][4]=new clsEmployee(objNurse[i].strNurseID,objNurse[i].strNurseName).m_StrFirstName;
								dtbNurse.Rows[i1][10]=objNurse[i].strNurseID;
								arlNurse.Add(objNurse[i].strNurseID);
