							}
							if(objNurse[i].strNurseFlag=="5"&&dtbNurse.Rows[i1][5].ToString()=="")
							{
								dtbNurse.Rows[i1][5]=new clsEmployee(objNurse[i].strNurseID,objNurse[i].strNurseName).m_StrFirstName;
								dtbNurse.Rows[i1][11]=objNurse[i].strNurseID;
								arlNurse.Add(objNurse[i].strNurseID);
								break;
									
							}
						}				
					}
				

				}
