		private void m_mthLoadAllOperationTimeOfAPatient(string p_strInPatientID,string p_strInPatientDate)
		{
			
			if(p_strInPatientID ==null || p_strInPatientDate =="") return ;
			DateTime [] m_dtmOpenDateArr=null;
			DateTime [] m_dtmCreateDateArr=null;

			long lngRes=m_objDomain .m_lngGetTimeInfoOfAPatientArr(p_strInPatientID ,p_strInPatientDate,out m_dtmOpenDateArr,out m_dtmCreateDateArr);
			if(lngRes<=0)
			{
				clsPublicFunction.ShowInformationMessageBox("数据库连接失败！");
				return;
			}
			if(m_dtmOpenDateArr==null) return ;
			this.trvTime.Nodes[0].Nodes .Clear();
			for(int i=0;i<m_dtmCreateDateArr.Length ;i++)
			{		
				string strDate=m_dtmCreateDateArr[i].ToString("yyyy年MM月dd日 HH:mm:ss");
				TreeNode trnDate=new TreeNode(strDate);
				trnDate.Tag =m_dtmOpenDateArr[i].ToString("yyyy-MM-dd HH:mm:ss");;
				this.trvTime.Nodes[0].Nodes.Add(trnDate );
				
			}
			
			this.trvTime.ExpandAll();

			this.trvTime.SelectedNode = this.trvTime.Nodes[0].Nodes[0];
		}

		private void m_mthClearUpSheet()
		{
			m_strCurrentOpenDate = "";

			foreach(Control ctlRichText in this.Controls )
			{
				string typeName = ctlRichText.GetType().Name;
				if(typeName == "ctlRichTextBox")
				{
					
					((com.digitalwave.controls.ctlRichTextBox)ctlRichText).m_mthClearText();
			
				}
			}
			dtgNurse.CurrentRowIndex =0;
			dtbNurse.Clear();	
			
		}
		
		#endregion 

        protected bool m_blnCanShowDiseaseTrack = true;
		private void trvTime_AfterSelect(object sender, System.Windows.Forms.TreeViewEventArgs e)
		{
			if(blnCanSearch==false)
				return;

			m_mthRecordChangedToSave();

			m_mthClearUpSheet();
			arlNurse.Clear ();

            m_txtSign.Clear();
            m_txtSign.Tag = null;

			this.dtpOperationTime.Enabled =true;
			if(this.trvTime.SelectedNode.Tag!=null)
			{
                if (!m_blnCanShowDiseaseTrack)
                {
                    clsPublicFunction.ShowInformationMessageBox("该病案已归档，当前用户没有查阅权限");
                    return;
                }

				this.Cursor=Cursors.WaitCursor;
				m_mthShowCurrentSheet(m_strInPatientID,m_strInPatientDate,trvTime.SelectedNode.Tag.ToString());
				this.dtpOperationTime.Text =this.trvTime.SelectedNode.Text;
				this.dtpOperationTime.Enabled =false;				
				this.Cursor=Cursors.Default ;

				//当前处于修改记录状态
				MDIParent.m_mthChangeFormText(this,MDIParent.enmFormEditStatus.Modify );
			}
			else
			{
				this.dtpOperationTime.Value=DateTime.Now;
			    this.dtpOperationTime.Enabled =true;

				m_mthSetRichTextModifyColor(this,clsHRPColor.s_ClrInputFore);
				m_mthSetRichTextCanModifyLast(this,true);

				//当前处于新增记录状态
				MDIParent.m_mthChangeFormText(this,MDIParent.enmFormEditStatus.AddNew);
							
			}

			m_mthAddFormStatusForClosingSave();
		
		}
