				}
				else if(m_intColumnNumber==2)
				{
					if(m_objGridListView2==null||m_objGridListView2.strGetCurrentText()==null||m_objGridListView2.strGetCurrentText()=="")return;				
					strStringLike=m_objGridListView2.strGetCurrentText();
