					if(m_objGridListView5==null||m_objGridListView5.strGetCurrentText()==null||m_objGridListView5.strGetCurrentText()=="")return;				
					strStringLike=m_objGridListView5.strGetCurrentText();
				}

				clsEmployeeIDName[] objclsEmployeeIDNameArr=null;
				m_objDomain.m_lngGetEmployee(strStringLike,out objclsEmployeeIDNameArr);

				if(objclsEmployeeIDNameArr==null)
					return;

				for (int i=0; i<objclsEmployeeIDNameArr.Length; i++)
				{
					ListViewItem lviTemp=lsvLike.Items.Add(objclsEmployeeIDNameArr[i].strEmployeeID);
					lviTemp.SubItems.Add(objclsEmployeeIDNameArr[i].strEmployeeName);
				}	
				m_mthChangeListViewLastColumnWidth(lsvLike);
			}
			catch{}
		}
		
		

