				case 113://save
					this.Save(); 
					break;
				case 114://del
					this.Delete(); 
					break;
				case 115://print
					this.Print();
					break;
				case 116://refresh
					blnCanSearch =false;
					this.txtInPatientID.Text ="";
					blnCanSearch=true;
					m_mthClearPatientBaseInfo();
                    m_mthClearUpSheet();
					this.trvTime.Nodes[0].Nodes .Clear ();
					break;
