		public enmAutoTestResult i_enmTestModify(com.digitalwave.Utility.clsTestContentMaker p_objContentMaker, out string p_strInnerMessage)
		{
			if(txtInPatientID.Text!="0000002")
			{
				txtInPatientID.Text="0000002";
				if(m_lsvInPatientID.Items.Count>0)
				{
					m_lsvInPatientID.Items[p_objContentMaker.m_intNextSelectIndex(m_lsvInPatientID,m_lsvInPatientID.Items.Count-1)].Selected=true;
					if(m_lsvInPatientID.SelectedItems.Count > 0)
						m_mthSetPatientInfo((clsPatient)m_lsvInPatientID.SelectedItems[0].Tag);				
				}					
				else 
				{
					p_strInnerMessage ="";
					return enmAutoTestResult.Succeed;
				}
			}

			trvTime.SelectedNode = p_objContentMaker.m_trnNextTreeViewNode(trvTime);
			m_mthClearUpSheet();			
			dtpOperationTime.Value=dtpOperationTime.Value.AddSeconds(2);			
			dtpOperationTime.Enabled=true;

			foreach(Control ctlRichText in this.Controls )
			{
				string typeName = ctlRichText.GetType().Name;
				if(typeName == "ctlRichTextBox")
				{
						
					((com.digitalwave.controls.ctlRichTextBox)ctlRichText).Text = p_objContentMaker.m_strNextTextValue(ctlRichText,p_objContentMaker.m_ObjStringValueType,20);
				}

			}			
			long lngRes = m_lngSave();//由Save()函数屏蔽掉MessageBox提示,换成返回一个整数值而成(同时去掉所有相关函数中的MessageBox提示,换成返回一个整数值)
			
			p_strInnerMessage = " "+lngRes.ToString();
		
			if(lngRes > 0)
				return enmAutoTestResult.Succeed;
			else
				return enmAutoTestResult.Failure;
		}
		
